import React from 'react'

const VisibilityFilter = ({todos}) => {
  console.log("todos :",todos)
  return (
    <div>
      <h2>VISIBILITY FILTER</h2>

    </div>
  )
}

const mapStateToProps = (state) => ({
  todos: getTodos(state),
});
export default connect(mapStateToProp)(VisibilityFilter)
